import MainLayout from '../Layouts/MainLayout'


const POSPage = () => {

    const [product, setProduct] = useState([]);

    const fetcProducts = async () => {
        const res = await axios.get('products');
        setProduct(await res.data);
    }

    useEffect(() => {
        fetcProducts();
    })


    return (
        <div>
            <MainLayout>
                POS content
            </MainLayout>
        </div>
    )
}

export default POSPage
